import { registerIcon } from "@ui5/webcomponents-base/dist/SVGIconRegistry.js";

const name = "hint";
const pathData = "M320 449v31H192v-31h33V225h-32v-34h95v258h32zm-65-321q-20 0-34-14t-14-34 14-34 34-14 34 14 14 34-14 34-34 14z";

registerIcon(name, { pathData });

export default { pathData };
